import React from 'react';
import Layout from '../Layout/Layout';
import './project.css';
// import Card from '../Ui Kits/Cart/CT Card/Card';
// import { NavLink } from 'react-router-dom';
import CtCard from '../Ui Kits/Cart/CT Card/CtCard';
// images
var javascript_img = 'https://picsum.photos/200/300';

function Project(props) {
  console.log(javascript_img);
  return (
    <div>
      <Layout>
        <div className='pr_main_div'>
          <h1>Project Category</h1>
          <div className='category'>
            <CtCard
              ct_title='javascript'
              image='javascript_img'

              // src={require(`../../Assets/Images/${post.blogImage}`)}
            />
            <CtCard />
            <div>{javascript_img}</div>
            <CtCard />
            <CtCard />
          </div>
        </div>
      </Layout>
    </div>
  );
}

export default Project;
